operations.body:
query GetFeaturedListings {
  featuredListings {
    id
    description
    costPerNight
    locationType
    numOfBeds
    __typename
  }
}

query GetListing($listingId: ID!) {
  listing(id: $listingId) {
    id
    title
    description
    photoThumbnail
    numOfBeds
    costPerNight
    locationType
    host {
      id
      __typename
    }
    __typename
  }
}

query GetUser($userId: ID!) {
  user(id: $userId) {
    id
    name
    profilePicture
    ... on Host {
      profileDescription
      __typename
    }
    __typename
  }
}
